Assalamualaykum, I tried to implement the decode method:
```
        assert_eq!(q.decode("   "), ["kul huwa allahu ahad"]);
        assert_eq!(q.decode(" "), ["allahu alssamad"]);
        assert_eq!(q.decode("   "), ["lam yalid walam ywlad"]);
        assert_eq!(q.decode("    "), ["walam yakun lahu kufuwana ahad"]);
```

It should basically be the opposite of encode.

I think it works, but it's probably not perfect.

For example with the following: 
`assert_eq!(q.decode(" "), ["tabaraka alladzi"]);`

It fails returning "tabaraka allady" or "tabaraka allada" not sure why.

I think might be useful to someone looking for programatically transliterate some parts.
